import React from "react";
import Entry from "./Entry";
import emojipedia from "../emojipedia"; 

function App() {
  return (
    <div>
      <h1>
        <span>emojipedia</span>
      </h1>
      <dl className="dictionary">
        {emojipedia.map(function(emoji){


          return (

          <div key = {emoji.id}>
          <Entry emj = {emoji.emoji} 
          name = {emoji.name} 
          desc = {emoji.meaning} />

          </div>

          ) 
        })}
      </dl>
    </div>
  );
}

export default App;
